class t{static pipe(...t){return function(e){return t.reduce((t,e)=>e(t),e)}}static getHue(){return Math.floor(101*Math.random())+190}static getDirectionInRadians(){return Math.random()*Math.PI}static getHypoLength(t){return 10/Math.cos(t)}static getCoord(t){const e=t<0?-1:1;return Math.sqrt(t*t-100)*e}static getWidth(){return Math.floor(10*Math.random())+2}paint(e,r,n){for(let r=0;r<49;r+=1){const n=t.getDirectionInRadians(),a=t.pipe(t.getHypoLength,t.getCoord,Math.round)(n),o=6*r;e.beginPath(),e.moveTo(o,425),e.lineTo(o+a,435),e.lineWidth=t.getWidth(),e.strokeStyle=`hsl(${t.getHue()}deg, 85%, 49%)`,e.stroke()}}}registerPaint("borderPaint",t);